Ext.data.JsonP['Titanium_SDK_6.1.1.RC_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Titanium SDK 6.1.1.RC - 16 June 2017</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-49163164\" class=\"content\">\n                        <h1>Titanium SDK 6.1.1.RC - 16 June 2017</h1>\n    <div class=\"section section-2 \" id=\"src-49163164_TitaniumSDK6.1.1.RCReleaseNote-Contents\">\n        <h2 class=\"heading \"><span>Contents</span></h2>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_6.1.1.RC_Release_Note-section-src-49163164_TitaniumSDK6.1.1.RCReleaseNote-Aboutthisrelease\">About this release</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_6.1.1.RC_Release_Note-section-src-49163164_TitaniumSDK6.1.1.RCReleaseNote-Fixedissues\">Fixed issues</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_6.1.1.RC_Release_Note-section-src-49163164_TitaniumSDK6.1.1.RCReleaseNote-APIchanges\">API changes</a>    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-49163164_TitaniumSDK6.1.1.RCReleaseNote-Aboutthisrelease\">\n        <h2 class=\"heading \"><span>About this release</span></h2>\n    <p>Titanium SDK 6.1.1.RC is a patch release of the SDK which addresses important fixes for 6.1.0.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-49163164_TitaniumSDK6.1.1.RCReleaseNote-Fixedissues\">\n        <h2 class=\"heading \"><span>Fixed issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24665\" target=\"_blank\">TIMOB-24665</a> - Android: Fix inaccessible Ti.Media constants    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24680\" target=\"_blank\">TIMOB-24680</a> - iOS: Enterprise ad hoc provisioning profiles not validating properly for watch extensions    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24741\" target=\"_blank\">TIMOB-24741</a> - Android: Using &quot;transparent&quot; as a color crashes the app (Regression)    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24745\" target=\"_blank\">TIMOB-24745</a> - Android: Cannot build CommonJS modules with multiple JS files    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24748\" target=\"_blank\">TIMOB-24748</a> - Android: HTTPClient - can&apos;t use streaming mode with authentication    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24751\" target=\"_blank\">TIMOB-24751</a> - Windows: Cannot build for Android if Windows SDK is not installed    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24753\" target=\"_blank\">TIMOB-24753</a> - iOS: View sizes are incorrect in 6.1.0.GA (regression)    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24756\" target=\"_blank\">TIMOB-24756</a> - Android: Ti.UI.ImageView with &quot;images&quot; property causes crash    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24770\" target=\"_blank\">TIMOB-24770</a> - iOS: Incorrect badge display on Ti.UI.DashboardView (no background image)    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24778\" target=\"_blank\">TIMOB-24778</a> - CLI: Minimum android build tools is incorrect    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24792\" target=\"_blank\">TIMOB-24792</a> - Android: Horizontal layouts do not behave correctly with &apos;right&apos;    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24793\" target=\"_blank\">TIMOB-24793</a> - Android: Ti.UI.View.center is incorrectly calculated    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24796\" target=\"_blank\">TIMOB-24796</a> - iOS: Hybrid CommonJS and Native modules don&apos;t handle multiple js files    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24799\" target=\"_blank\">TIMOB-24799</a> - Android: Theme Causing Issues in SDK 6.2.2.GA    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24809\" target=\"_blank\">TIMOB-24809</a> - Android: HTTPClient - &quot;onload&quot; not dispatched    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-49163164_TitaniumSDK6.1.1.RCReleaseNote-APIchanges\">\n        <h2 class=\"heading \"><span>API changes</span></h2>\n    <p>There are no API-changes in this releases.    </p>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=49163164\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Titanium SDK 6.1.1.RC Release Note"});